	eval("module.exports = \"<h1 class=\\\"heading-xlarge\\\">\\n  <span class=\\\"heading-secondary\\\">Content</span>\\n  Data\\n</h1>\\n<h2 class=\\\"heading-small heading-contents\\\">Contents:</h2>\\n<ul class=\\\"list list-contents\\\">\\n    <li><a ui-sref=\\\"content.data({'#':'numeric-tabular-data'})\\\" href=\\\"#\\\">Numeric tabular data</a></li>\\n    <li><a ui-sref=\\\"content.data({'#':'data-in-a-table'})\\\" href=\\\"#\\\">Data in a table</a></li>\\n    <li><a ui-sref=\\\"content.data({'#':'data-visualisation'})\\\" href=\\\"#\\\">Data visualisation</a></li>\\n</ul>\\n<section class=\\\"docs-section\\\" id=\\\"gov-data-demo\\\">\\n    <h3 class=\\\"heading-medium\\\" id=\\\"numeric-tabular-data\\\">Numeric tabular data</h3>\\n    <p class=\\\"text\\\">When comparing rows of numbers, align numbers to the right in table cells.</p>\\n    <docs-example language=\\\"markup\\\">\\n        <table class=\\\"table\\\">\\n            <thead>\\n                <tr>\\n                    <th scope=\\\"col\\\">Date</th>\\n                    <th class=\\\"numeric\\\" scope=\\\"col\\\">Paper form</th>\\n                    <th class=\\\"numeric\\\" scope=\\\"col\\\">Digital</th>\\n                </tr>\\n            </thead>\\n            <tbody>\\n                <tr>\\n                    <td>25 November to 1 December 2013</td>\\n                    <td class=\\\"numeric\\\">2,763</td>\\n                    <td class=\\\"numeric\\\">1,792</td>\\n                </tr>\\n                <tr>\\n                    <td>2 to 8 December 2013</td>\\n                    <td class=\\\"numeric\\\">2,850</td>\\n                    <td class=\\\"numeric\\\">1,740</td>\\n                </tr>\\n                <tr>\\n                    <td>9 to 15 December 2013</td>\\n                    <td class=\\\"numeric\\\">2,388</td>\\n                    <td class=\\\"numeric\\\">1,683</td>\\n                </tr>\\n            </tbody>\\n        </table>\\n    </docs-example>\\n    <h3 class=\\\"heading-medium\\\" id=\\\"data-in-a-table\\\">Data in a table</h3>\\n    <p class=\\\"text\\\">Not all content in tables should be right aligned.</p>\\n    <docs-example language=\\\"markup\\\">\\n        <table class=\\\"table\\\">\\n            <thead>\\n                <tr>\\n                    <th scope=\\\"col\\\">Date</th>\\n                    <th class=\\\"numeric\\\" scope=\\\"col\\\">Paper form</th>\\n                    <th class=\\\"numeric\\\" scope=\\\"col\\\">Digital</th>\\n                </tr>\\n            </thead>\\n            <tbody>\\n                <tr>\\n                    <td>25 November to 1 December 2013</td>\\n                    <td class=\\\"numeric\\\">2,763</td>\\n                    <td class=\\\"numeric\\\">1,792</td>\\n                </tr>\\n                <tr>\\n                    <td>2 to 8 December 2013</td>\\n                    <td class=\\\"numeric\\\">2,850</td>\\n                    <td class=\\\"numeric\\\">1,740</td>\\n                </tr>\\n                <tr>\\n                <td>9 to 15 December 2013</td>\\n                    <td class=\\\"numeric\\\">2,388</td>\\n                    <td class=\\\"numeric\\\">1,683</td>\\n                </tr>\\n            </tbody>\\n        </table>\\n    </docs-example>\\n    <h3 class=\\\"heading-medium\\\" id=\\\"data-visualisation\\\">Data visualisation</h3>\\n    <ul class=\\\"list list-bullet text\\\">\\n      <li>data is recommended as an alternative to using images</li>\\n      <li>for screen readers, ensure the data value appears first so it makes sense when read aloud</li>\\n    </ul>\\n    <docs-example language=\\\"markup\\\">\\n      <div class=\\\"grid-row\\\">\\n        <div class=\\\"column-one-half\\\">\\n          <div class=\\\"data\\\">\\n            <h2 class=\\\"bold-xxlarge\\\">24</h2>\\n            <span class=\\\"bold-xsmall\\\">Ministerial departments</span>\\n          </div>\\n        </div>\\n        <div class=\\\"column-one-half\\\">\\n          <div class=\\\"data\\\">\\n            <h2 class=\\\"bold-xxlarge\\\">80px</h2>\\n            <span class=\\\"bold-xsmall\\\">16px</span>\\n          </div>\\n        </div>\\n      </div>       \\n    </docs-example>\\n    <docs-example language=\\\"markup\\\">\\n      <div class=\\\"grid-row\\\">\\n        <div class=\\\"column-one-half\\\">\\n          <div class=\\\"data\\\">\\n            <h2 class=\\\"bold-xlarge\\\">56/154</h2>\\n            <span class=\\\"bold-xsmall\\\">on GOV.UK</span>\\n          </div>\\n        </div>\\n        <div class=\\\"column-one-half\\\">\\n          <div class=\\\"data\\\">\\n            <h2 class=\\\"bold-xlarge\\\">48px</h2>\\n            <span class=\\\"bold-xsmall\\\">16px</span>\\n          </div>\\n        </div>\\n      </div>\\n    </docs-example>\\n</section>\";//# sourceMappingURL=data:application/json;charset=utf-8;base64,");

